(1251, 1464, 1, 0, 0, 5358, 'White walk-in closet organizer with center island and shoe storage', NULL, 'Master Closet Organizers', 'Master Bedroom', NULL, '', '<div class=\"showroom-block organizer-loading-page\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0% 1% 0% 1%; font-family: OpenSans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Organize Your Life with Our Walk-In Closet Organizers: Our organizers are more than just a place to store your clothes. They\'re designed to help you keep your closet tidy with easy access to clothing and accessories. With adjustable shelves, hanging rods, and drawers, you can create a custom configuration that fits your needs. You\'ll be able to find everything you need quickly and easily, meaning you\'ll spend less time getting ready and more time doing the things that matter to you. You\'ll be amazed at how much easier it is to get dressed and start your day with an organized closet.</span></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, 'â€œMaybe the Life You Wanted is Buried Under Everything You Ownâ€', 'Joshua Becker', 'Master Closet Organizers', 'View our showroom walk-in closet organizers', 0, 0, 0, 0, 0, 1, NULL, NULL, 'walk in closet organization, walk in closet organizer systems, walk in closet systems, walk in closet storage, walk in closet shelving, walk in closet solutions', NULL, 0, 0, 262, 70, 'We have revolutionized kitchen organization with our pantry organizers. Instead of simply stacking items on a shelf, you can arrange them efficiently, ultimately saving you money. This pantry system features a spice rack that is convenient for perfect spice selection and also includes wire baskets for fruits and bagged items, tilted shelves for canned goods, drawers for table cloths and vertical dividers for storing cookie sheets. The corner wrap shelving unit allows for additional storage of larger items or small appliances.&nbsp; The countertop provides a place to unload groceries. As if that wasn\'t enough, this system comes complete with a wine rack for proper, sideways storage. All this is within reach with our pampered pantry organizer.', '83 7/8&rdquo; is the recommended fixing rail height (or otherwise noted on your design). Using a tape measure, measure 83 7/8&rdquo; from the floor up the wall and make a mark at each corner as well as the middle of the wall.', 'The hanging brackets are fully adjustable. They have two screws located on the back of the bracket. The top screw raises and lowers the system so you can level off each section. The bottom screw is used to push and pull the system to the wall. This is done after each section has been leveled. (Note do not over tighten screws as they can strip)', '#c99797', '#4d72a3', '#95e486', '<div>Our custom closet organizers are designed with your specific wardrobe needs in mind. Whether you\'re searching for the perfect closet system for that special someone in your life or more organization for your childrens\' rooms, we\'ve got you covered! Browse our digital showroom for ideas and see the elegant and modern solutions we offer for your closet today.&nbsp;</div>', '<div>We\'ve taken all the guesswork out of installation.</div>\r\n<div>&nbsp;</div>\r\n<div>Here you can find an overview of the installation process, watch a video on how to install your closet system, and download our fully illustrated and comprehensive installation guide. If you still need help, just contact us!</div>', 4349, 4350, 4351, 'https://www.closetstogo.com/', 'https://designitpro.com/CTG-website-FE/', 'https://www.expertanswer.org/'),
(1274, 1467, 1, 0, 0, 5560, '', NULL, 'Murphy Beds', '', NULL, '', '<div class=\"showroom-block organizer-loading-page\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0% 1% 0% 1%; font-family: OpenSans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Introducing our space-saving easy to use Wall Bed System, perfect for those who want to maximize their living space without sacrificing comfort and style.The system is designed to seamlessly integrate into any room, providing a comfortable sleeping solution that can be easily hidden away when not in use. It is the perfect solution for small apartments, guest rooms, and home offices, providing a convenient sleeping space that won\'t take up valuable floor space. Our Wall Bed System is available in a variety of styles and finishes, so you can choose the one that best matches your home\'s decor.</span></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, '', '', '', '', 0, 0, 0, 0, 0, 1, NULL, NULL, '', NULL, 1, 0, 245, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL, NULL, NULL),
(1305, 0, 1, 0, 0, 0, '', NULL, 'ADA Closets', '', NULL, '', '', NULL, 1, NULL, 0, 0, '', '', '', '', 0, 0, 0, 0, 0, 0, NULL, NULL, '', NULL, 1, 0, 333, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL, NULL, NULL),
(1276, 1433, 1, 0, 0, 5698, '', NULL, 'Linen Room', '', NULL, '', '<div class=\"showroom-block organizer-loading-page\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0% 1% 0% 1%; font-family: OpenSans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">When it comes to organizing linens and towels, it can be difficult to keep everything straight and organized, especially when you have multiple sets of bedding and towels. This is where a custom linen closet can come in handy. With a custom linen closet, you can have dedicated storage spaces for each item, ensuring that everything has its own designated spot. This means that you can keep your towels separate from your bedding, and even organize your linens by size or color. As a result, you\'ll never have to worry about grabbing the wrong towel or bedding set again. </span></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, '', '', '', '', 0, 0, 0, 0, 0, 1, NULL, NULL, '', NULL, 1, 0, 259, 7, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL, NULL, NULL),
(1253, 1461, 1, 0, 0, 5269, 'white kids walk-in closet organizer with drawer trays and hutch system', NULL, 'Kids Closet', 'Kids Closet', NULL, '<p dir=\"ltr\" style=\"line-height: 1.38; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<div><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></div>\r\n<span id=\"docs-internal-guid-64cf9734-7fff-7e84-e61d-f28c55c44876\"></span>', '<div class=\"showroom-block organizer-landing-pages\">\r\n<div class=\"wrapper\" style=\"position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0pt 1% 0pt 1%; font-family: Open Sans, Sans Serif; color: #808080; font-size: 11pt;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin: 0pt 1% 0pt 1%;\"><span style=\"font-size: 11pt; font-family: OpenSans-Regular, sans-serif; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Designing with forethought is key to any custom kids closet. Explore how we can help meet the needs of your child\'s space today while leaving flexibility for growth in the future. While toy storage may be a top priority now, shoes might be the rage in the teen years to come. Incorporating adjustable components like shelving, cubbies and wardrobe tubes will allow your kids\' closet or play room to adapt to their growing needs.</span></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, '', '', '', 'View our showroom selection of kids closet organizers', 0, 0, 0, 0, 0, 1, NULL, NULL, 'Custom kids closets, Kids closet organizers, Closet toy storage system, Kids room closet organization, Toy closet shelving, Closet for kids room', NULL, 0, 0, 269, 32, '', '', '', '#000000', '#000000', '#000000', '', '', 4256, 4257, 4258, 'https://www.closetstogo.com/', 'https://www.closetstogo.com/', 'https://www.closetstogo.com/'),
(1254, 83, 1, 0, 0, 5836, 'Home Office', NULL, 'Office Closet Systems', 'Home Office', NULL, '', '<div class=\"showroom-block organizer-landing-pages\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0pt 1% 0pt 1%; font-family: Open Sans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Home office storage solutions come in many shapes and sizes but all should ultimately cater to your specific individual needs. An office space at home should ultimately enhance your workflow and productivity by providing a functional yet comfortable layout with easy access to all pertinent needs. This is why customized home office organization systems are the optimal solution in creating a space suited to your specific needs and style. </span></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, '', '', '', 'Home Office', 0, 0, 0, 0, 0, 1, NULL, NULL, 'Custom home offices, Home office storage solutions, Home office organization systems, Office organization systems, Office storage organizer, Home office storage systems, Office organization systems', NULL, 0, 0, 248, 28, '', '', '', '#e8baba', '#92aec3', '#f77e7e', '', '', 4261, 4262, 0, '', '', ''),
