(1256, 1466, 1, 0, 0, 5361, 'white craft system', NULL, 'Craft Closets', 'Craft Closet Organization', NULL, '', '<div class=\"showroom-block organizer-landing-pages\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0% 1% 0% 1%; font-family: OpenSans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-family: helvetica, arial, sans-serif;\"><span style=\"font-size: 11pt; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">No matter what your hobbies are: painting, sewing, building models, or if you simply have a passion for all things DIY, our craft closet organizer systems will get you on your way to effortless productivity and creativity.&nbsp;</span><span style=\"font-size: 11pt; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Avoid the daunting task of constantly rummaging drawers throughout the house for crafting supplies and tools. A well designed craft storage system should be a space you love crafting in while&nbsp; providing a hassle free, time saving solution customized to your specific hobbyist needs. </span><span style=\"font-size: 11pt; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">And you don\'t need an entire room dedicated to your hobbies. Oftentimes, an open spare wall is all that\'s needed for a well organized craft storage closet which is great for those on a tight budget!&nbsp; With our DIY service option and with very little handy skills, you can install a craft storage organizer at your convenience, save SIGNIFICANTLY and yield professional results!&nbsp;<br /></span></span>