(1266, 1459, 1, 0, 0, 5465, 'Reach In Closets', NULL, 'Reach In Closets', 'Reach In Closets', NULL, '', '<div class=\"showroom-block organizer-loading-page\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0% 1% 0% 1%; font-family: OpenSans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In nearly all new home builds, the typical reach in closet layout is a basic shelf and pole! </span><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In nearly all new home builds, the typical reach in closet layout is a basic shelf and pole! This standard is sub par to say the least as it leaves so much wasted valuable space, not to mention, you are still left with clutter! Our reach in closet systems are specifically designed to maximize every precious square inch of usable space from floor to ceiling, often doubling your real estate! The often forgotten space is the several feet above that standard top shelf to the ceiling. Though it may be too high to routinely reach, it is the optimal place for seasonal clothing, seldomly used items or large bulky items. </span></p>\r\n<span id=\"docs-internal-guid-4ecb2edb-7fff-f285-1573-6c7cbea1b6cc\"></span>\r\n<p id=\"docs-internal-guid-a6d52d47-7fff-5d27-fedf-b2715e03e195\" dir=\"ltr\" style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, '', '', '', 'Bedroom Closets', 0, 0, 0, 0, 0, 1, NULL, NULL, 'reach in closet organizers, reach in closet systems, custom reach in closets, reach in closet layout, reach in closet drawers, reach