(1304, 1442, 1, 0, 0, 6127, '', NULL, 'LED Cabinetry Lighting', '', NULL, '', '<div class=\"showroom-block organizer-loading-page\">\r\n<div class=\"wrapper\" style=\"padding-top: 2%; position: relative; display: flex; flex-wrap: wrap; text-align: justify; margin: 0% 1% 0% 1%; font-family: OpenSans, sans serif; color: #808080;\">\r\n<p dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">When you have a custom closet with LED lighting options, you can easily illuminate your entire closet space, including those hard-to-see dark corners. This allows you to quickly and easily find the clothes or items you\'re looking for, without having to fumble around in the dark. We offer a variety of LED lighting options, from warm to cool tones and even color-changing lights, so you can choose the perfect lighting to fit your personal style. With our custom closet lighting solutions, you can transform your closet into a well-lit and organized space that makes your life easier and more enjoyable. </span></p>\r\n</div>\r\n</div>', NULL, 1, NULL, 0, 0, '', '', '', '', 0, 0, 0, 0, 0, 0, NULL, NULL, '', NULL, 1, 0, 1, 7, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL, NULL, NULL);
