(2096, 70, 1, 0, 5950, '', 0, 0, 1677533633, 2222222222, 'Deluxe Garage Organizer', 'with work bench, peg board, storage cabinets, adjustable shelving, aluminum door handles', '<h4><span style=\\\"font-size: medium;\\\">Do you look to make sure no one is around before opening your garage door due to the clutter? With the Deluxe Garage Organizer you&rsquo;re free to open those doors with pride! </span><br /><br /><span style=\\\"font-size: medium;\\\">This sleek system features a spacious workbench for building or repairing, a peg board to hold frequently used smaller items, drawers for smaller tool box items and shelving with aluminum handled doors to give the room a uniform look. The system is elevated off the floor to allow for spills or weather leakage. Organize your garage once and for all with the Deluxe Garage Organizer and proudly open the garage doors for all to admire. Available in your choice of color.</span></h4>\r\n<h4><span style=\\\"font-size: medium;\\\">Click below to create your custom closet organizers or visit our California closet factory showroom and see how easy closets are to create and install.</span></h4>\r\n<h4><span style=\\\"font-size: medium;\\\">Option 1: Sit back and let our white glove service come to you! We will measure your space, design and install a closet organizer that you can\\\'t wait to show friends and family.</span></h4>\r\n<h4><span style=\\\"font-size: medium;\\\">Option 2: DIY. With the aid of our online design software, you can create your organizer to your exact specifications and instal your organizer on your schedule.</span></h4>', '', '', '0.00', '0.00', 0, 0, '0.00', 0, 0, 0, 0, 0, NULL, 0, NULL, NULL, NULL, '0', '0', '0', NULL, 0, 0, 0, 0, 0, 0, '', '', NULL, 0, '0', 0, 0, 0, 0, 1, 2, '', 2, 0, 0, 0, 0, 0, 'garage-cabinetry/', '21,1072,garage-cabinetry,garage-cabinetry|deluxe-garage-organizer', 'garages, Garage Systems, garage organizer, Deluxe Garage Organizer, Garage', 0, 'http://www.onlineclosetdesigner.com/cu