(2087, 3595, 1, 0, 0, 'Closets To Go Her Reach In Closet Organizer', 0, 0, 1617128097, 3234256194, 'Her Reach In Closet Organizer', 'with shoe cubbies, adjustable shelving, long hanging closet rods, drawers', '<h4><span style=\"font-size: medium;\">In search of a timeless, chic closet organizer that will make you sigh with satisfaction as you open your closet? What woman doesn\'t? Treat yourself to the Her Reach In Closet Organizer and feel that sense of satisfaction every time you open your closet doors.</span></h4>\r\n<h4><span style=\"font-size: medium;\">Catering to the shoe lover in us all, we direct your gaze to our shoe cubbies. Each section holds one pair of shoes comfortably, with shelves below for taller boots and booties. Atop of the shoe bank, we have open shelving which are great for purses or additional shoes. Next, you will see the medium hanging section with shelves above, designed for everyday dresses and pants hung long. Finally, we reveal the dresser for folded items and undergarments, but we&rsquo;re not done yet! The icing on this cake is the valet rod that attaches to the side of the unit and extends outward, displaying an outfit for dinner tonight or work tomorrow. Available in your choice of color.</span></h4>\r\n<h4><span style=\"font-size: medium;\">Click below to create your custom closet organizers or visit our California closet factory showroom and see how easy closets are to create and install.</span></h4>\r\n<h4><span style=\"font-size: medium;\">Option 1: Sit back and let our white glove service come to you! We will measure your space, design and install a closet organizer that you can\'t wait to show friends and family.</span></h4>\r\n<h4><span style=\"font-size: medium;\">Option 2: DIY. With the aid of our online design software, you can create your organizer to your exact specifications and instal your organizer on your schedule.</span></h4>', NULL, NULL, '0.00', '0.00', 0, 0, '0.00', 0, 1, 0, 123, 0, NULL, 0, NULL, NULL, NULL, '',