(3327, 3675, 1, 0, 5235, '', 0, 0, 1673247755, 2222222222, 'Pantry - Walk-in - Oxford White Floor Window', 'Elegant is not a typical word used when talking about pantry organizers but there really is no better way to describe this beauty!&nbsp; The natural light from the window and the rich hardwood floors complement the soft white finish just perfectly.', '<div>Balance and symmetry were a must in this nearly square shaped space. The center unit is perfectly anchored between the two corner wrap units creating a nice focal point. The open pull out shelves allow finding versus searching and the Oil Rubbed Bronze accessories perfectly tie into the darker striations in the hardwood floor.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Adjustable shelves are a must in custom built pantries and this design is full of them. They allow for endless versatility as your storage needs change in the years to come. The easy view pull out baskets are perfect for foods requiring ventilation. And yes, feel free to stop and enjoy the view as you nestle your appliances on the countertop</div>\r\n<div><br />\r\n<ul style=\\\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\\\">\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Oxford White finish against dark hardwood floors</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\