s for easy viewing and access</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Frosted glass door for fronts for hiding unsightly clutter</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Tilt shelves with chrome stop for canned goods, viewing all at one glance</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Deep laminate countertop for prep or storage</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p d