(3340, 3684, 1, 0, 4453, '', 0, 0, 1659647700, 2222222222, 'Pantry - Walk-in - Oxford White Floor Radius Shelves', 'This custom built kitchen pantry proves there is a silver lining to every obstacle! Short return walls would typically resort in shallow shelves but by adding floating shelves at the entrance this area can be utilized without narrowing the doorway and blocking the view!', '<div>We must boast about our design team for this one!&nbsp;</div>\r\n<div>To avoid blocking the doorway with a solid side panel, our design team utilized&nbsp; &ldquo;floating&rdquo; shelves in this area to maintain the nice wide doorway while giving functional use to the space.&nbsp;</div>\r\n<div>With two built-in countertops and electrical outlets at both, this walk in pantry becomes the perfect place to start every morning with a coffee bar and toaster oven!&nbsp;</div>\r\n<div>Corner wrap shelves are a must have to conserve space and adjustable shelving will offer versatility in the years to come with the option to adjust heights as needed or even add more. There is space left above the pantry for seasonal items and a combination of drawer types. Covered drawers to tuck away clutter and pullout baskets for easy viewing.</div>\r\n<div><br />\r\n<ul style=\\\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\\\">\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Oxford White color makes the space look large</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Stanton 128mm satin nickel handles for easy pull out</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Radius shelves versus a solid side panel to prevent blocking the doorway</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">4- 7&rdquo; chrome baskets for ease of use and visualization</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">1-10&rdquo; &amp; 3-7-&frac12;&rsquo; Drawers for covered storage of additional items</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Corner shelves for deeper storage and maximizing all of the space</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Laminate countertops for prep space or storage</span></p>\r\n</li>\r\n<li dir=\\\"ltr\\\" style=\\\"list-style-type: disc; font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\\\" aria-level=\\\"1\\\">\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\" role=\\\"presentation\\\"><span style=\\\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">77&rdquo; x 61&rdquo; space</span></p>\r\n</li>\r\n</ul>\r\n<span id=\\\"docs-internal-guid-f703adfb-7fff-42a8-a5c6-ee045f16d0d9\\\"></span></div>', NUL