(3427, 4875, 1, 3359, 5147, '0', 105, 0, 1680732796, 2222222222, 'Built In Walk In Closet - American Black Walnut', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This custom master walk in closet system is simply exquisite with its rich Black Walnut wood grain finish which is accentuated by the natural light within. </span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">By taking advantage of the high ceilings, this built in closet has it all! The focal point of this space is the floor to ceiling armoire perfectly centered between the two upper windows. The natural light sets the stage to show off the striations in the deep rich finish. Medium hang units are custom fit right under these windows with room for drawers beneath.&nbsp; More variations in hanging lengths are at the adjacent walls ensuring a perfect spot for his and hers&rsquo; clothing. The upper cabinets with upgraded shaker style door fronts are a perfect dust free space to store out of season items while the crown molding ties in the look nicely.&nbsp; An entire unit is dedicated to shoes with a combination of storage styles: adjustable shelves to fit multiple types of shoes and cubbies to fit flats, ballets and sandals. Corner warp shelves maximize the usable space in the corner while keeping the view open. A hidden tilt out laundry hamper keeps unsightly clutter tucked away nicely. Additional closet accessories that really personalize this space are a compact swivel mirror, pant rack, pop out valets and a tie rack (not shown). This design goes to show how decked out walk in closet organizer systems can be. </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull;</span> American black walnut color to closely match door frame</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull;</span> 15 x 9 large room size</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull;</span> Designed as built in to take advantage of ultra high ceilings</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull;</span> Floor to ceiling armoire for dust free storage</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; 