(3357, 4880, 1, 0, 5159, '0', 105, 0, 1680732984, 2222222222, 'Walk In Closet with Glass Fronts & Laundry - Oxford White', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Lugging laundry up and down the steps is a thing of the past with this walk in closet organizer.&nbsp; With a washer and dryer built right in, this design boasts the ultimate convenience. The pull down hanging rods add another layer of comfort in this perfectly tailored space. </span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Being so spacious, this walk in closet system has plenty of room to let the imagination run wild. Functionality is center stage starting with a floor to ceiling built in style that utilizes every square inch. Covered storage cabinets at the top are the optimal space for seasonal items while tilt out hampers provide coverage for unsightly dirty laundry. Multiple hanging length sections, including a display hanging space,&nbsp; provide a perfect place for every item in this shared space. The natural light from the window adds a nice ambiance to this already serene space. Nestled underneath is the perfect space for the dresser with eight good sized drawers. This spacious custom walk in closet truly has it all. </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asia