(3358, 4857, 1, 0, 5136, '0', 105, 0, 1680724424, 2222222222, 'Luxury Master Walk In for Her - Antique White', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Sheer elegance exudes this dreamy luxury closet just for her! It showcases the vision brought to life by our Expert Design Team and is loaded with features that take it over the top in opulence. </span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">For such a small space, this built-in closet organizer is rich in features. The chandelier, LED lit display cases and crown molding to name a few.&nbsp; The antique white finish elegantly contrasts with the royal blue walls providing a very regal feel. Though its aesthetic beauty may overwhelm your focus, this custom walk in closet system is highly functional as well. An entire wall dedicated to show storage and will bring guaranteed smiles to her face. Though the upper storage cabinets may be out of reach for everyday use, they serve as dust free display cases perfect for storing high end luxury items all emphasized with LED lighting. The island in this closet is dainty in size but really serves this closet well in terms of scale. Lastly, shaker door fronts are the optimal choice for this design in keeping a very clean boutique style vibe. The omnipresent light supported by the natural glow from the window gives this space an ethereal feel giving new meaning to the term dream closet!&nbsp; </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24p