(3363, 4867, 1, 3371, 5215, '0', 105, 0, 1680726606, 2222222222, 'Walk In Pantry - Oxford White', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Elegant is not a typical word used when talking about pantry organizers but there really is no better way to describe this beauty!Â  The natural light from the window and the rich hardwood floors complement the soft white finish just perfectly.</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Balance and symmetry were a must in this nearly square shaped space. The center unit is perfectly anchored between the two corner wrap units creating a nice focal point. The open pull out shelves allow finding versus searching and the Oil Rubbed Bronze accessories perfectly tie into the darker striations in the hardwood floor.Â  Adjustable shelves are a must in custom built pantries and this design is full of them. They allow for endless versatility as your storage needs change in the years to come. The easy view pull out baskets are perfect for foods requiring ventilation. And yes, feel free to stop and enjoy the view as you nestle your appliances on the countertop</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-s