gn: baseline; white-space: pre-wrap;\\\"><strong>Approximate room size</strong>:Â  10â€™8â€ x 8â€™5â€â€™; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Panel lengths</strong>: 86.5â€ standard; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Shelf depth</strong>: 14.75â€ standard and 20â€; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>1 enclosed drawer</strong>: 30w x 7.5h x 18d; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>2 pull out shelves</strong>: 30w x 7.5h x 18d; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>1 short drawer</strong>: 30w x 5h x 18d; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Countertop</strong>: 49â€w x 21â€d;</span></p>\r\n<div><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Â </span></div>\r\n<span id=\\\"docs-internal-guid-d99492cd-7fff-9ccd-9510-03866539803b\\\"></span>', '0.00', '0.00', 0, 0, '0.00', 0, 0, 0, 0, 0, NULL, 0, NULL, NULL, NULL, '0', '0', '0', NULL, 0, 0, 0, 0, 0, 0, '', '', NULL, 0, '0', 0, 0, 0, 0, 6, 4, '', 2, 1, 0, 0, 0, 1, '', '', '', 0, 'https://storittek.com//closet-organizers', 0