(3370, 4869, 1, 3372, 5233, '0', 105, 0, 1680726804, 2222222222, 'Walk In Pantry with LED - Silver Frost', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Deck the pantry with boughs of holly, fa la la la la la la la la... While this custom pantry system is a decked out showroom piece, it goes to show you the options are endless in personalizing the perfect space for you! </span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This immaculate walk in kitchen pantry is lit up like a Christmas tree with an incredible LED lighting package! From the toe kicks to the lighting within the cabinets, everything stored will be easy to find while the warm glow provides a nice ambiance. A tall, frosted glass storage cabinet and oversized drawer are two less common storage options but are perfectly suited for unsightly mops, brooms, ect and bulk items like pet food or bulk bag food items.&nbsp; Convertible wine cubbies, tilted can shelves, pull out shelves and baskets show just how versatile customized pantry storage can be! The adjustable corner wrap shelves are as spectacular as a bonus room as they add so much usable space to the design. And the vertical dividers&hellip; well don\\\'t we all wish we had them? </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: 