(3372, 4866, 1, 0, 5207, '0', 105, 0, 1680726386, 2222222222, 'Reach In Pantry with Glass Doors - Custom Grey Glass fronts', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Mirror mirror on the wall; who is the tidiest kitchen pantry of them all? Why this one with the see through glass door front of course! </span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">At only five feet wide this pantry organizer truly has it all! Every detail was thought out not only to create a functional space but also an aesthetically pleasing one.&nbsp; As all will be on display with the glass door fronts, a thoughtful design was necessary to fulfill both needs.&nbsp; This reach in style pantry offers&nbsp; space for all the essentials. Covered drawers and pull out baskets offer versatility while vertical dividers and small cubbies optimize the storage space. The homeowner embellished the design with added wire storage baskets which give it a very tidy look and utilize the space above the top shelf. </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull;</span> Popular Custom Gray is on trend and brightens the space</span></p>\r\n<p dir=\\\"ltr\\\" style=\