(3466, 4879, 1, 0, 5722, '0', 105, 0, 1680732928, 2222222222, 'Master Walk In Custom Closet - Oxford White', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This gloriously bright walk in closet system greets its homeowner every morning. The natural light from the window reflecting off the bright white finish is certain to bring cheer to every day!</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This custom walk in closet organizer was specifically designed with a large window as the focal point and a floor to ceiling built in option that really upgrades the closet to a high end feel. It includes such a variety of storage styles ensuring a place for everything! At center, the large countertop is a perfect place for pictures, keepsakes or even a spot to fold clothes while the full dresser beneath ensures plenty of space for personal items. The end walls are sprinkled with varying hanging lengths for his and her tops, pants and medium to long dresses. And in between, there are multiple adjustable shelves for shoes, folded clothing and handbags. There is even a hidden dirty clothes hamper below. The custom closet is topped off with crown molding, a vented toe kick and Oil Rubbed Bronze accessories for a pop of color!</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font