(3382, 4850, 1, 0, 5329, '0', 0, 0, 1680721298, 2222222222, 'Home Office Organizer within Nook - Chocolate Pear', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">With this space saving home office organizer, a standard reach in closet is converted into an extension of the room by removing its doors and creating a custom designed space.</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">A common practice when converting a room in the home into an office, is to utilize the enclosed closet as an organized storage space for office supplies, document filing, ect. In this case, it was converted into a gorgeous minibar with display area within the home office.&nbsp; This straightforward design with clean lines and no use of hardware opens up the space and enlarges the look while the dark Chocolate Pear adds an upscale vibe. A double hutch with a generous countertop works perfectly as an entertainment area to serve drinks while the adjustable shelves are great for displaying personal items, framed photos and keepsakes. The toe skin at the bottom gives a built in feel to the system. </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull;</spa