(3404, 4732, 1, 0, 5362, '0', 0, 0, 1680560684, 2222222222, 'Open Wall Craft Organizer System - Sandalwood', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Considering its tiny footprint, you\\\'ll be pleasantly surprised with the storage capability of this well planned craft organizer system!</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">At just fifteen inches deep, you wouldn\\\'t believe the amount of storage this craft storage system is capable of. At center the elongated work station with LED lighting shining down offers ample space to work on projects. A backing of slat wall provides a super space saving way to hold and store many tools and accessories and also keeps your crafting countertop clear as you work.&nbsp; Nine drawers of varying sizes are nestled below, including an extra wide wrapping paper drawer!&nbsp; Each side unit has a slew of adjustable and fixed adjustable shelving units along with multiple sizes of easy view pull out baskets.&nbsp; Three vertical dividers above offer additional storage for less used items.&nbsp; The LED valance along with top and bottom fascia nicely ties off the look! As you can see this tiny&nbsp; craft closet packs a punch!</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-alig