(3409, 4589, 1, 0, 5428, '0', 0, 0, 1680131508, 2222222222, 'Enhance Your Wine Collection with a Custom Backwoods Sycamore Wine Rack System', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Create a luxurious atmosphere with our Wine Rack System. Hand-carved grapevine arch, LED lighting, and custom design. Contact us for a free consultation!</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Introducing the ultimate Wine Rack System in a stunning Backwoods Sycamore finish! This exquisite wine rack has been designed to not only showcase your favorite bottles of wine, but also to create a luxurious and elegant atmosphere in your home. Crafted with the finest materials and finished with intricate details, this wine rack system is the perfect addition to any wine enthusiast\\\'s collection. Featuring a spacious countertop area for tastings, wine cubbies, crosses, and diagonals for various sized bottles, and bottle display rows, this wine rack is both functional and stylish. The drawers, both open top and closed, offer ample space for storing all of your wine accessories, while the arch with hand-carved grapevine above the tasting area adds a touch of sophistication and class. The stem holders for wine glasses behind the drop-down tasting table ensure that your glasses are always within easy reach, and the LED lighting adds a warm and inviting glow to your wine collection. The crown molding, doors with glass inserts, and intricate design details make th