(3508, 4570, 1, 0, 5905, '0', 0, 0, 1680128455, 2222222222, 'Elevate Your Closet Space with Our Custom Wardrobe System | Shaker Fronts, Mirror Inserts', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Transform your closet with our elegant Custom Wardrobe System in Oxford White finish. Shaker fronts, mirror inserts, shoe fences, and more. Get a free design!</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Introducing our stunning Custom Wardrobe System in Oxford White finish, designed to elevate your closet space to new heights of elegance and functionality. With a sleek shaker front design featuring mirror inserts, this wardrobe system adds a touch of sophistication to any bedroom or dressing room. Inside, you\\\'ll find sloped shelves complete with shoe fences, providing ample storage space for your shoe collection while keeping them organized and easily accessible. The gold hardware adds a luxurious touch to the overall look, ensuring your wardrobe system is not only practical but also a stylish statement piece in your home. What\\\'s more, this custom wardrobe system features adjustable shelves, allowing you to customize the space to suit your needs perfectly. Whether you need more hanging space or more shelving, this system can adapt to your storage needs with ease. Our experienced team of designers is standing by, ready to create a custom wardrobe system that is tailored to your specific needs and preferences. With our complimentary design service, you can explore endless possibilities and create the closet of your dreams. Don\\\'t settle for a basic closet system - upgrade to our Custom Wardrobe System and experience the ultimate in style and functionality. Reach out to us today for your free custom closet design, and let us bring your vision to life.</span></p>', '', '<p dir=\\\"ltr\\\" style=\\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Approximate Wall Size</strong>: </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">L 13&rsquo; 6&rdquo;;<strong> </strong></span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Panel Height</strong>: </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">H 86.5&rdquo;; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Panel Depth</strong>: </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">D 20&rdquo;; </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><strong>Drawers</strong>: </span><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-