(3510, 4882, 1, 0, 5917, '0', 105, 0, 1680733115, 2222222222, 'Walk In Closet with LED Package - Oxford White', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">There is a night and day difference in the before and after pictures of this walkin in closet system thanks to a customized LED lighting package!</span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">When you have an enclosed space with poor lighting, a LED package is a must. With a custom&nbsp; walk in closet, this optional upgrade can be strategically placed to help light the way or highlight or showcase specifics in your wardrobe.&nbsp; This floor based master closet design is lit from head to toe and highlights many wardrobe items. The main wall has tilted shoe shelves capped with a shoe fence. This section takes center stage as it is perfectly situated between two identical corner wrap shelf units giving this design a very balanced feel. A combination of medium and long hanging units will provide a space for multiple clothing lengths and there is certainly plenty of covered drawer space. The shaker style door fronts add dimension as the oversized handles add a contemporary touch. There is even a tilt out laundry hamper that is discreetly placed low behind the door front. All in all, the LED lighting makes all the difference in this particular space. </span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; colo