(3627, 4519, 1, 0, 6228, '0', 0, 0, 1680034355, 2222222222, 'Wardrobe Fog Grey Pewter', '<span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"></span><span id=\\\"docs-internal-guid-cab7b68d-7fff-7b77-1331-f3de367ebb51\\\"><span style=\\\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">A minimalist would love this reach-in closet layout for the man of the house. The rich textured color and LED lighting set the stage and highlight all of his fine suits. </span></span>', '<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 12pt; margin-bottom: 12pt;\\\"><span style=\\\"color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This unique two tone design would give any customer pride in their closet. The rich color screams upscale. With the addition of the LED lighting above the hanging, you come full circle in sophistication. The deep drawers below are full extension and at the bottom you have open drawers for shoe storage. At the top are flip up doors for enclosed shelves, keeping the dust away from occasionally worn items. The lighting above the hanging helps see the true colors so no mistaking dark blue with black. This reach in closet organizer gives all the space, organization and sophistication needed for even the most distinguished taste.</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-height: 24px; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"padding-left: 6%; color: #7e7e7e; font-size: 16px; font-family: Futurica-BS-Book; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><span style=\\\"color: #6d6d6d; font-size: 8pt;\\\">&bull; </span>Fog Grey base with Pewter Pine textured fronts</span></p>\r\n<p dir=\\\"ltr\\\" style=\\\"line-heig