(1, 1, '<p>I personally wanted to reach out and thank you for your recent purchase from Closets To Go.<br /><br />You\'ve put your trust in us to assist you in creating what we hope was a great experience as reflected in our customer service on through the finished product. So that we may continue to provide you and others with outstanding products and customer service we would greatly appreciate if you could fill out a review from the link below. We know everyone has busy lives and we really are grateful for your time.<br /><br /><br /><br />Kindest Regards,<br />Closets To Go&nbsp;<br />Jeff Turner&nbsp;<br />President<br /><br /></p>', '<p>I personally wanted to reach out and thank you for your recent purchase from Closets To Go.<br /><br />You\'ve put your trust in us to assist you in creating what we hope was a great experience as reflected in our customer service on through the finished product. So that we may continue to provide you and others with outstanding products and customer service we would greatly appreciateif you could fill out a review from the link below. We know everyone has busy lives and we really are grateful for your time.<br /><br /><br /><br />Kindest Regards,<br />Closets To Go&nbsp;<br />Jeff Turner&nbsp;<br />President</p>');
